function controllaParola(p) {
    indici = [];
    for (let i = 0; i < p.length; i++) {
        // posizione corretta
        if (p[i] == parola[i]) {
            indici.push(i);
        }
    }
    console.log("Lettere nella posizione esatta: " + indici);
    for (let i = 0; i < indici.length; i++) {
        let_giuste += p[indici[i]] + " ";
    }
    return indici;
}

function controllaLettera(p) {
    indici = [];
    for (let i = 0; i < p.length; i++) {
        var ricerca = parola[i];
        // TOFIX: con la parola CHINE, e l'ipotesi CICCO le lettere
        // si colorano nel modo sbagliato
        var re = new RegExp(ricerca, "gm");
        risultato = p.match(re);
        console.log("risultato " + risultato);
        if(risultato != null && p[i] != parola[i]){
            console.log("index " + p.indexOf(parola[i],i));
            indici.push(p.indexOf(parola[i]));
        }
        //console.log(risultato);
    }
    console.log("Lettere presenti " + indici);
    for (let i = 0; i < indici.length; i++) {
        let_presenti += p[indici[i]] + " ";
    }
    return indici;
}

